VALUES('742af8c8-4638-4b42-98be-9b87b62c87f6', 'd2473611-f71d-4f07-959c-e08f784bf016', 'Prancha', '4', '60', 'Corporal', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/Abs/Prancha.png', 'https://www.youtube.com/watch?v=qNRqGqESAWU', 'Apoie os antebraços no chão e mantenha o corpo reto, contraindo o abdômen. Segure a posição pelo tempo determinado.', '2025-02-28 20:02:44.800', '2025-02-28 20:02:44.800');
VALUES('32e8a6f0-b525-4fa8-9ecb-010e11e4e7a3', 'd2473611-f71d-4f07-959c-e08f784bf016', 'Vácuo de estômago em pé', '4', '60', 'Corporal', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/Abs/V%C3%A1cuo+de+est%C3%B4mago+em+p%C3%A9.png', 'https://www.youtube.com/watch?v=AFthLwQ-9u0', 'Fique em pé e contraia o abdômen, puxando o umbigo em direção à coluna. Mantenha a contração pelo tempo determinado.', '2025-02-28 20:02:44.930', '2025-02-28 20:02:44.930');
VALUES('55849f95-7436-462f-861c-a0ddb6437004', '00390cbe-cf6f-4a5e-850a-9bf3550d335f', 'Rosca de Punho com Barra Sentado', '4', '12', '10', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-de-punho-com-barra-sentado.png', 'https://www.youtube.com/watch?v=x4q8CEgNcZY', 'Sente-se em um banco e apoie os antebraços nas coxas, segurando a barra com as palmas voltadas para cima. Deixe os pulsos levemente para fora dos joelhos e abaixe a barra lentamente. Em seguida, flexione os punhos para cima, contraindo os antebraços, e retorne à posição inicial.', '2025-03-02 05:59:05.425', '2025-03-02 05:59:05.425');
VALUES('e9253c3b-f087-4675-9ea5-879fe8da0885', '00390cbe-cf6f-4a5e-850a-9bf3550d335f', 'Rosca de Punho com Barra por Trás do Corpo', '4', '12', '10', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-de-punho-com-barra-por-trás-do-corpo.png', 'https://www.youtube.com/watch?v=TvDgrGNPzeQ', 'Fique em pé segurando a barra atrás do corpo, com as palmas voltadas para trás e os braços estendidos. Deixe os punhos relaxarem para baixo, permitindo que a barra desça levemente. Em seguida, flexione os punhos para cima, contraindo os antebraços, e retorne lentamente à posição inicial.', '2025-03-02 06:03:13.239', '2025-03-02 06:03:13.239');
VALUES('40bc08e1-80f3-4310-bc94-6320ae1d0e39', '00390cbe-cf6f-4a5e-850a-9bf3550d335f', 'Rosca Inversa com Barra', '4', '12', '10', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-inversa-com-barra.png', 'https://www.youtube.com/watch?v=CUaRRBbRPgA', 'Segure a barra com as palmas voltadas para baixo (pegada pronada) e os braços estendidos à frente do corpo. Flexione os cotovelos, levantando a barra até a altura dos ombros, mantendo os cotovelos próximos ao corpo. Controle a descida da barra até a posição inicial e repita o movimento.', '2025-03-02 06:06:36.451', '2025-03-02 06:06:36.451');
VALUES('594e43e7-ef14-4559-a2be-fc48af79d68d', '00390cbe-cf6f-4a5e-850a-9bf3550d335f', 'Rosca Inversa na Polia', '4', '12', '10', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-inversa-na-polia.png', 'https://www.youtube.com/watch?v=Ji_KYs4w59U', 'Segure a barra da polia baixa com as palmas voltadas para baixo (pegada pronada) e os braços estendidos. Flexione os cotovelos, trazendo a barra em direção aos ombros, mantendo os cotovelos próximos ao corpo. Controle a descida até a posição inicial e repita o movimento', '2025-03-02 06:07:56.575', '2025-03-02 06:07:56.575');
VALUES('caa13f28-0de3-4a6a-b649-dd7f906e52a9', '00390cbe-cf6f-4a5e-850a-9bf3550d335f', 'Caminhada do Fazendeiro com Halteres', '4', '12', '10', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/caminhada-do-fazendeiro-com-halteres.png', 'https://www.youtube.com/watch?v=MTxG3rboW9A', 'Segure um haltere em cada mão com os braços estendidos ao lado do corpo. Mantenha a postura ereta, ative o core e caminhe uma distância determinada ou pelo tempo desejado. Evite balançar o corpo e mantenha os ombros estabilizados durante o movimento', '2025-03-02 06:08:54.239', '2025-03-02 06:08:54.239');
VALUES('d9052584-7789-48fe-a765-fcd6cc7786cd', '00390cbe-cf6f-4a5e-850a-9bf3550d335f', 'Rosca de Punho com Halteres Pegada Neutra Sentado', '4', '12', '10', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-de-punho-com-halteres-pegada-neutra-sentado.png', 'https://www.youtube.com/watch?v=x4q8CEgNcZY', 'Sente-se em um banco e apoie os antebraços nas coxas, segurando um haltere em cada mão com pegada neutra (polegares voltados para cima). Deixe os punhos relaxarem para baixo e, em seguida, flexione-os para cima, contraindo os antebraços. Controle a descida dos halteres até a posição inicial e repita o movimento', '2025-03-02 06:10:34.357', '2025-03-02 06:10:34.357');
VALUES('8c74661a-d695-431f-918d-748e2ddebd9a', '00390cbe-cf6f-4a5e-850a-9bf3550d335f', 'Rosca de Punho com Halter Unilateral Sentado', '4', '12', '10', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-de-punho-com-halter-unilateral-sentado.png', 'https://www.youtube.com/watch?v=agVfOWgs21Y', 'Sente-se em um banco e apoie o antebraço de um dos braços na coxa, segurando um halter com a palma voltada para cima. Deixe o punho relaxar para baixo e, em seguida, flexione-o para cima, contraindo os antebraços. Controle a descida do halter até a posição inicial e repita o movimento antes de trocar de braço.', '2025-03-02 06:11:32.833', '2025-03-02 06:11:32.833');
VALUES('400c52e2-f7fc-42f5-9ac4-b95fce98cd78', '00390cbe-cf6f-4a5e-850a-9bf3550d335f', 'Rosca Inversa com Barra EZ', '4', '12', '10', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-inversa-com-barra-ez.png', 'https://www.youtube.com/watch?v=41c-KLO0bvc', 'Segure a barra EZ com pegada pronada (palmas para baixo) e os braços estendidos à frente do corpo. Flexione os cotovelos, trazendo a barra em direção aos ombros, mantendo os cotovelos próximos ao corpo. Controle a descida até a posição inicial e repita o movimento.', '2025-03-02 06:12:17.667', '2025-03-02 06:12:17.667');
VALUES('cbfea356-8e84-4f84-b649-7cbeb6c82162', '00390cbe-cf6f-4a5e-850a-9bf3550d335f', 'Rosca de Punho Inversa com Barra sobre o Banco', '4', '12', '10', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rosca-de-punho-inversa-com-barra-sobre-o-banco.png', 'https://www.youtube.com/watch?v=7HlHT0g2XVQ', 'Ajoelhe-se atrás de um banco e apoie os antebraços sobre a superfície, segurando a barra com pegada pronada (palmas para baixo). Deixe os punhos relaxarem para baixo e, em seguida, flexione-os para cima, contraindo os antebraços. Controle a descida da barra até a posição inicial e repita o movimento.', '2025-03-02 06:13:16.743', '2025-03-02 06:13:16.743');
VALUES('c43dbd22-c55a-4244-b0bf-5d72a8a6ca09', '00390cbe-cf6f-4a5e-850a-9bf3550d335f', 'Caminhada com Anilhas Pinçadas', '4', '12', '10', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/caminhada-com-anilhas-pinçadas.png', 'https://www.youtube.com/shorts/_7surmCE6pY', 'Segure uma ou duas anilhas entre os dedos e o polegar, apertando-as firmemente para manter a pegada. Mantenha a postura ereta, ative o core e caminhe uma distância determinada ou pelo tempo desejado. Evite deixar as anilhas escorregarem e mantenha o controle durante todo o movimento.', '2025-03-02 06:15:23.848', '2025-03-02 06:15:23.848');
VALUES('ec409e5a-1d50-468c-a653-42a97e036ef7', '802de8d5-4df6-4da1-94bf-22c92a0b4606', 'Hiperextensão', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/hiperextensão.png', 'https://www.youtube.com/watch?v=ds9aX5XGBa0', 'Deite-se de bruços em um banco romano, prendendo os pés. Cruze os braços no peito e incline o tronco para frente até formar um ângulo de 90°. Levante o tronco de volta à posição inicial, contraindo a lombar.', '2025-03-10 01:24:59.013', '2025-03-10 01:24:59.013');
VALUES('f99d8157-0257-4e36-9bf5-dd93fc0ebbf5', '802de8d5-4df6-4da1-94bf-22c92a0b4606', 'Elevação de Quadril com Barra', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/elevação-de-quadril-com-barra.png', 'https://www.youtube.com/watch?v=CQqNVA8hGY4', 'Sente-se no chão com as costas apoiadas em um banco e a barra sobre o quadril. Com os pés firmes no chão, empurre os quadris para cima até formar uma linha reta dos ombros aos joelhos. Contraia os glúteos no topo e desça controladamente.', '2025-03-10 01:25:52.417', '2025-03-10 01:25:52.417');
VALUES('7f93d784-1a97-4874-b99b-58ddde7193a9', '802de8d5-4df6-4da1-94bf-22c92a0b4606', 'Chute Traseiro em Pé', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/chute-traseiro-em-pé.png', 'https://www.youtube.com/watch?v=UFwzSgdUaQE', 'Fique em pé e segure-se em um apoio para equilíbrio. Com a perna estendida, chute para trás lentamente, contraindo os glúteos. Retorne à posição inicial sem tocar o pé no chão e repita.', '2025-03-10 01:26:57.079', '2025-03-10 01:26:57.079');
VALUES('b9afa4c7-eac7-4a77-b342-6889a083cca7', '802de8d5-4df6-4da1-94bf-22c92a0b4606', 'Chute Traseiro', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/chute-traseiro.png', 'https://www.youtube.com/watch?v=UFwzSgdUaQE', 'Apoie mãos e joelhos no chão ou em um banco. Mantendo o joelho levemente flexionado, eleve a perna para trás até a altura do quadril, contraindo os glúteos. Retorne controladamente e repita.', '2025-03-10 01:27:58.797', '2025-03-10 01:27:58.797');
VALUES('937acc56-c2b3-483c-b0ca-cdca45796e28', '0c0541d9-e251-40ab-b9cb-65ed4b873c29', 'Levantamento Terra Romeno com Halteres', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/levantamento-terra-romeno-com-halteres.png', 'https://www.youtube.com/watch?v=0epPATwggs8', 'Fique em pé com os pés na largura dos ombros, segurando um halter em cada mão. Mantendo as costas retas e os joelhos levemente flexionados, incline o tronco para frente, descendo os halteres até sentir alongamento nos posteriores da coxa. Retorne à posição inicial contraindo os glúteos.', '2025-03-10 12:06:55.029', '2025-03-10 12:06:55.029');
VALUES('8aeb41f8-0147-4c41-818f-d2f3ce56c213', '0c0541d9-e251-40ab-b9cb-65ed4b873c29', 'Levantamento Terra Convencional', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/levantamento-terra-convencional.png', 'https://www.youtube.com/watch?v=jSomWOwLiGE', 'Fique em pé com os pés na largura dos ombros e a barra próxima às canelas. Agarre a barra com as mãos ligeiramente além da largura dos ombros, mantendo as costas retas. Empurre o chão com os pés, estenda o quadril e levante a barra até ficar totalmente ereto, depois retorne controladamente.', '2025-03-10 12:07:46.495', '2025-03-10 12:07:46.495');
VALUES('a85b2c68-610d-4a78-9117-0426aade2e7c', '0c0541d9-e251-40ab-b9cb-65ed4b873c29', 'Levantamento Terra Pernas Rígidas', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/levantamento-terra-pernas-rígidas.png', 'https://www.youtube.com/watch?v=6yD7NMMgos4', 'Fique em pé com os pés na largura dos ombros, segurando a barra com as mãos afastadas na largura dos ombros. Mantendo as pernas quase retas e as costas alinhadas, incline o tronco para frente, descendo a barra até sentir alongamento nos posteriores da coxa. Retorne à posição inicial contraindo os glúteos.', '2025-03-10 12:08:36.086', '2025-03-10 12:08:36.086');
VALUES('8ba09f48-47b6-4864-ad94-c80a6150e71d', '0c0541d9-e251-40ab-b9cb-65ed4b873c29', 'Flexão de Pernas', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/flexão-de-pernas.png', 'https://www.youtube.com/watch?v=yiPqK5WMcNw', 'Deite-se no aparelho de leg curl com os tornozelos posicionados sob o rolo. Flexione os joelhos, trazendo o peso em direção aos glúteos, contraindo os posteriores da coxa. Retorne lentamente à posição inicial e repita.', '2025-03-10 12:09:30.168', '2025-03-10 12:09:30.168');
VALUES('f5b0c9d2-bd09-45bd-9677-114a6af1f6b7', '0c0541d9-e251-40ab-b9cb-65ed4b873c29', 'Flexão de Pernas Sentado', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/flexão-de-pernas-sentado.png', 'https://www.youtube.com/watch?v=OimHxUbO5DQ', 'Sente-se no aparelho de leg curl e ajuste o rolo sobre os tornozelos. Flexione os joelhos, trazendo o peso em direção aos glúteos, contraindo os posteriores da coxa. Retorne lentamente à posição inicial e repita.', '2025-03-10 12:10:42.417', '2025-03-10 12:10:42.417');
VALUES('1408a9ac-feee-4fed-85e7-7bacc7550186', 'b8dd87b7-39b6-4a66-843c-0f7f77eb143c', 'Círculos com Perna em Quatro Apoios', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/círculos-com-perna-em-quatro-apoios.png', 'https://www.youtube.com/watch?v=i_skOyupPm0&t=2s', 'Apoie mãos e joelhos no chão, mantendo as costas retas. Levante uma perna lateralmente e faça movimentos circulares controlados com o joelho. Complete as repetições e troque de lado.', '2025-03-10 20:54:40.439', '2025-03-10 20:54:40.439');
VALUES('ab3e6419-a01a-44e2-bdb5-d7564a1ab883', 'b8dd87b7-39b6-4a66-843c-0f7f77eb143c', 'Mobilização da Cápsula Posterior do Quadril Ajoelhado', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/mobilização-da-cápsula-posterior-do-quadril-ajoelhado.png', 'https://www.youtube.com/watch?v=3VbcdlWbfGA', 'Ajoelhe-se com um pé à frente, formando um ângulo de 90° no joelho. Incline-se levemente para frente, empurrando o quadril em direção ao solo enquanto mantém a coluna neutra. Segure a posição por alguns segundos e repita, alternando os lados.', '2025-03-10 20:55:29.068', '2025-03-10 20:55:29.068');
VALUES('d1453a65-2990-45c2-80f2-82b888cac66e', 'b8dd87b7-39b6-4a66-843c-0f7f77eb143c', 'Flexão de Quadril em Pé com Faixa', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/flexão-de-quadril-em-pé-com-faixa.png', 'https://www.youtube.com/watch?v=DnKTr00z-Po', 'Prenda uma faixa de resistência em um ponto fixo e no tornozelo. Fique em pé e eleve o joelho à frente até a altura do quadril, mantendo o tronco ereto. Retorne controladamente à posição inicial e repita, depois troque de perna.', '2025-03-10 20:56:12.736', '2025-03-10 20:56:12.736');
VALUES('178b061b-5b5c-4867-9856-32d15c592e77', 'b8dd87b7-39b6-4a66-843c-0f7f77eb143c', 'Caminhada de Berço para Avanço', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/caminhada-de-berço-para-avanço.png', 'https://www.youtube.com/watch?v=0hcYm2WIn2A', 'Segure a canela de uma perna com as mãos e traga-a em direção ao peito, alongando o glúteo. Solte a perna e dê um passo à frente, descendo em um avanço até o joelho de trás quase tocar o chão. Retorne à posição inicial e repita com a outra perna.', '2025-03-10 20:57:04.031', '2025-03-10 20:57:04.031');
VALUES('f924550a-6915-492b-96d3-c896da2c043b', 'b8dd87b7-39b6-4a66-843c-0f7f77eb143c', 'Liberação do Flexor do Quadril com Bola de Lacrosse', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/liberação-do-flexor-do-quadril-com-bola-de-lacrosse.png', 'https://www.youtube.com/watch?v=7Q_OuHSltwk', 'Deite-se de bruços e posicione uma bola de lacrosse na região do flexor do quadril. Aplique pressão lentamente e mova o corpo levemente para encontrar pontos de tensão. Mantenha a posição por alguns segundos e respire fundo para relaxar a musculatura.', '2025-03-10 20:58:04.850', '2025-03-10 20:58:04.850');
VALUES('ce8bc422-1e1f-4b09-9e43-d6766c4cf1e6', 'b8dd87b7-39b6-4a66-843c-0f7f77eb143c', 'Liberação do Flexor do Quadril com Rolo de Espuma', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/liberação-do-flexor-do-quadril-com-rolo-de-espuma.png', 'https://www.youtube.com/watch?v=mpMEZk-ATJs', 'Deite-se de bruços e posicione um rolo de espuma abaixo dos flexores do quadril. Apoie os antebraços no chão e role lentamente para frente e para trás, aplicando pressão na região. Concentre-se nos pontos de tensão por alguns segundos antes de continuar.', '2025-03-10 20:58:55.843', '2025-03-10 20:58:55.843');
VALUES('93ab712f-e752-47f6-ab0e-ccac00a5c70f', 'b8dd87b7-39b6-4a66-843c-0f7f77eb143c', 'Caminhada de Berço', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/caminhada-de-berço.png', 'https://www.youtube.com/watch?v=3S-ssi14_fU', 'Fique em pé e segure a canela de uma perna, puxando-a em direção ao peito enquanto mantém o equilíbrio. Solte a perna e dê um passo à frente, repetindo o movimento com a outra perna. Continue alternando os lados enquanto caminha.', '2025-03-10 20:59:38.823', '2025-03-10 20:59:38.823');
VALUES('cbb6bede-359f-462d-8b02-5d973085c7d8', 'b8dd87b7-39b6-4a66-843c-0f7f77eb143c', 'Marcha de Psoas Deitado', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/marcha-de-psoas-deitado.png', 'https://www.youtube.com/watch?v=cew6zz-YMHg', 'Deite-se de costas com os joelhos dobrados e os pés no chão. Pressione a lombar contra o solo, levante um joelho em direção ao peito e segure a posição por um segundo. Retorne lentamente e repita com a outra perna, alternando os lados.', '2025-03-10 21:00:13.105', '2025-03-10 21:00:13.105');
VALUES('ecdf55a0-1f08-4ccd-801f-9008461a8e33', 'b9e37de2-105b-4daa-ba8e-35411a0d5c28', 'Liberação da Banda Iliotibial com Rolo de Espuma', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/liberação-da-banda-iliotibial-com-rolo-de-espuma.png', 'https://www.youtube.com/watch?v=MmeTBH7AScQ', 'Deite-se de lado com o rolo de espuma posicionado abaixo da lateral da coxa. Apoie o antebraço no chão e role lentamente do quadril até o joelho, aplicando pressão na banda iliotibial. Concentre-se nos pontos de tensão e repita no outro lado.', '2025-03-10 21:01:48.793', '2025-03-10 21:01:48.793');
VALUES('34bde3ed-34e6-419e-bfef-7abeae282aae', '116ad9ec-fad6-4c38-8c37-9fb5f060ccbe', 'Levantamento Terra com Halteres', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/levantamento-terra-com-halteres.png', 'https://www.youtube.com/watch?v=9TJFEDuWzQg', 'Fique em pé com os pés na largura dos ombros, segurando um halter em cada mão à frente do corpo. Mantendo as costas retas e o core ativado, desça os halteres em direção ao chão, flexionando os joelhos e empurrando o quadril para trás. Retorne à posição inicial, estendendo o quadril e contraindo os glúteos.', '2025-03-12 11:50:45.916', '2025-03-12 11:50:45.916');
VALUES('6f801409-e92f-4313-86c1-6d11ec1651a5', '116ad9ec-fad6-4c38-8c37-9fb5f060ccbe', 'Superman', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/superman.png', 'https://www.youtube.com/watch?v=D07urmRplHQ', 'Deite-se de bruços com os braços estendidos à frente. Simultaneamente, levante os braços, o peito e as pernas do chão, contraindo a lombar e os glúteos. Segure por um segundo no topo, depois retorne lentamente à posição inicial e repita.', '2025-03-12 11:51:54.294', '2025-03-12 11:51:54.294');
VALUES('655c6b32-1291-44b7-a77b-aafc2650b433', '116ad9ec-fad6-4c38-8c37-9fb5f060ccbe', 'Levantamento Terra na Máquina Smith', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/levantamento-terra-na-máquina-smith.png', 'https://www.youtube.com/watch?v=xyINEfTy5OU', 'Fique em pé com os pés na largura dos ombros, posicionando a barra da máquina Smith próxima às canelas. Segure a barra com as mãos afastadas na largura dos ombros, flexione os joelhos e empurre o quadril para trás. Estenda o corpo para levantar a barra, contraindo os glúteos no topo. Retorne lentamente à posição inicial e repita.', '2025-03-12 11:53:02.046', '2025-03-12 11:53:02.046');
VALUES('354e363b-f614-4c35-9a80-7928fb01aa50', '116ad9ec-fad6-4c38-8c37-9fb5f060ccbe', 'Rotação de Quadril 90/90', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rotação-de-quadril-90/90.png', 'https://www.youtube.com/watch?v=rPqdiiX2aZA', 'Deite-se de costas com os joelhos dobrados em 90 graus e os braços estendidos lateralmente. Gire os joelhos para um lado até quase tocarem o chão, mantendo os ombros fixos. Retorne ao centro e repita para o outro lado.', '2025-03-12 11:53:59.525', '2025-03-12 11:53:59.525');
VALUES('de087005-ed66-4c29-bdd6-3880d137d509', '116ad9ec-fad6-4c38-8c37-9fb5f060ccbe', 'Rolamento para V-Sit', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rolamento-para-v-sit.png', 'https://www.youtube.com/watch?v=zWlfhnkJdNk', 'Deite-se de costas e role para trás, trazendo os joelhos em direção à cabeça. Impulsione o corpo para frente, estendendo as pernas e equilibrando-se nos glúteos em posição de V. Retorne controladamente e repita o movimento.', '2025-03-12 11:54:47.674', '2025-03-12 11:54:47.674');
VALUES('3475086d-291e-424f-876a-5d3a6c5282c3', '14378703-be64-49b2-b434-e2317b3f179b', 'Remada Curvada com Halteres', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/remada-curvada-com-halteres.png', 'https://www.youtube.com/watch?v=DhewkuU_95s', 'Fique em pé, segurando um halter em cada mão, e incline o tronco para frente mantendo as costas retas. Puxe os halteres em direção ao abdômen, contraindo as escápulas. Retorne lentamente à posição inicial e repita.', '2025-03-12 11:28:31.112', '2025-03-12 11:28:31.112');
VALUES('33236b81-aad0-4a52-97bd-0341482a76ec', '14378703-be64-49b2-b434-e2317b3f179b', 'Remada Unilateral com Halter', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/remada-unilateral-com-halter.png', 'https://www.youtube.com/watch?v=YZgVEy6cmaY', 'Apoie uma mão e o joelho do mesmo lado em um banco, mantendo as costas retas. Com a outra mão, segure um halter e puxe-o em direção ao abdômen, contraindo as escápulas. Retorne lentamente à posição inicial e repita, depois troque de lado.', '2025-03-12 11:29:22.122', '2025-03-12 11:29:22.122');
VALUES('94dcd256-6fca-4b17-87b7-61fb29762f66', '14378703-be64-49b2-b434-e2317b3f179b', 'Remada Curvada', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/remada-curvada.png', 'https://www.youtube.com/watch?v=paCfxhgW6bI', 'Fique em pé com os pés na largura dos ombros e segure a barra ou halteres com as mãos afastadas na largura dos ombros. Incline o tronco para frente, mantendo as costas retas, e puxe o peso em direção ao abdômen, contraindo as escápulas. Retorne lentamente à posição inicial e repita.', '2025-03-12 11:43:27.840', '2025-03-12 11:43:27.840');
VALUES('283f371c-d949-4d5e-9aed-b88de6cd0465', '14378703-be64-49b2-b434-e2317b3f179b', 'Remada Baixa no Cabo', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/remada-baixa-no-cabo.png', 'https://www.youtube.com/watch?v=f8AVh4VBbos', 'Sente-se no aparelho de remada, mantendo os pés apoiados e os joelhos levemente flexionados. Segure a alça com as mãos na largura dos ombros e puxe-a em direção ao abdômen, contraindo as escápulas. Retorne lentamente à posição inicial e repita.', '2025-03-12 11:44:52.628', '2025-03-12 11:44:52.628');
VALUES('c3d5dbb4-aa14-4e7d-8848-96f92868173b', '14378703-be64-49b2-b434-e2317b3f179b', 'Remada Tripod com Halter', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/remada-tripod-com-halter.png', 'https://www.youtube.com/watch?v=78Z2mk9LQoI', 'Fique em pé e apoie uma mão em um banco ou superfície firme, mantendo os pés afastados e o tronco inclinado. Com a outra mão, segure um halter e puxe-o em direção ao abdômen, contraindo as escápulas. Retorne lentamente à posição inicial e repita, depois troque de lado.', '2025-03-12 11:45:36.751', '2025-03-12 11:45:36.751');
VALUES('5980611f-2605-4ad7-afd9-98b80390a09a', '14378703-be64-49b2-b434-e2317b3f179b', 'Remada Curvada com Pegada Supinada', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/remada-curvada-com-pegada-supinada.png', 'https://www.youtube.com/watch?v=TD00shuX6hA', 'Fique em pé, segurando um halter em cada mão com as palmas voltadas para cima. Incline o tronco para frente, mantendo as costas retas, e puxe os halteres em direção ao abdômen, contraindo as escápulas. Retorne lentamente à posição inicial e repita.', '2025-03-12 11:46:36.465', '2025-03-12 11:46:36.465');
VALUES('db20613c-783c-4b79-bdfa-4239f53ab6d1', '14378703-be64-49b2-b434-e2317b3f179b', 'Remada na Máquina', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/remada-na-máquina.png', 'https://www.youtube.com/watch?v=QyvIEdEHzHc', 'Sente-se no aparelho de remada, ajustando o banco e o apoio para o peito. Segure as alças com as mãos na largura dos ombros e puxe-as em direção ao tronco, contraindo as escápulas. Retorne lentamente à posição inicial e repita.', '2025-03-12 11:48:00.897', '2025-03-12 11:48:00.897');
VALUES('118bdc2b-4647-4c6d-abd6-3c0e0c9607ed', '14378703-be64-49b2-b434-e2317b3f179b', 'Remada T-Bar', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/remada-t-bar.png', 'https://www.youtube.com/watch?v=gJSov9rHIf0', 'Posicione-se sobre a barra em formato de "T", segurando o pegador com as mãos na largura dos ombros. Com os joelhos levemente flexionados e o tronco inclinado para frente, puxe a barra em direção ao abdômen, contraindo as escápulas. Retorne lentamente à posição inicial e repita.', '2025-03-12 11:48:41.981', '2025-03-12 11:48:41.981');
VALUES('8c286f9e-3e99-4c2d-9686-4660e70c26dc', '6beb2180-1553-4989-b3a8-b952b5a10494', 'Pulldown (Puxada para Costas)', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/pulldown-(puxada-para-costas).png', 'https://www.youtube.com/watch?v=iKrKgWR9wbY', 'Sente-se no aparelho de polia alta e segure a barra com as mãos afastadas além da largura dos ombros. Puxe a barra em direção à parte superior do peito, contraindo as escápulas. Retorne lentamente à posição inicial e repita.', '2025-03-12 12:01:13.574', '2025-03-12 12:01:13.574');
VALUES('bfeca336-5530-48e3-a36a-b7c4a858391d', '6beb2180-1553-4989-b3a8-b952b5a10494', 'Pulldown com Pegada Fechada', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/pulldown-com-pegada-fechada.png', 'https://www.youtube.com/watch?v=uAyrz5GTEHg', 'Sente-se no aparelho de polia alta e segure a barra com as mãos próximas, palmas voltadas para frente. Puxe a barra em direção à parte superior do peito, contraindo as escápulas. Retorne lentamente à posição inicial e repita.', '2025-03-12 12:02:05.194', '2025-03-12 12:02:05.194');
VALUES('c2b76cb1-6d55-4da0-ab96-f280ff2e89e7', '6beb2180-1553-4989-b3a8-b952b5a10494', 'Pulldown com Braços Retos', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/pulldown-com-braços-retos.png', 'https://www.youtube.com/watch?v=gDtXrJWPdlY', 'Fique em pé diante da polia alta e segure a barra com as mãos afastadas na largura dos ombros. Mantendo os braços estendidos e o tronco levemente inclinado, puxe a barra para baixo até a altura dos quadris, contraindo as costas. Retorne lentamente à posição inicial e repita.', '2025-03-12 12:02:47.808', '2025-03-12 12:02:47.808');
VALUES('4c0f95a5-5846-4e45-b5b2-a01a1d26f03a', '6beb2180-1553-4989-b3a8-b952b5a10494', 'Barra Fixa com Pegada Aberta', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/barra-fixa-com-pegada-aberta.png', 'https://www.youtube.com/watch?v=5oxviYmdHCY', 'Segure a barra com as mãos afastadas além da largura dos ombros e os braços estendidos. Puxe o corpo para cima até o queixo ultrapassar a barra, contraindo as escápulas. Desça lentamente até a posição inicial e repita.', '2025-03-12 12:03:34.321', '2025-03-12 12:03:34.321');
VALUES('ae566600-5771-4e45-ae60-c6e2d3ef0b74', '6beb2180-1553-4989-b3a8-b952b5a10494', 'Pulldown com Pegada Supinada', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/pulldown-com-pegada-supinada.png', 'https://www.youtube.com/watch?v=8DAFwftgZHQ', 'Sente-se no aparelho de polia alta e segure a barra com as mãos na largura dos ombros, palmas voltadas para você. Puxe a barra em direção à parte superior do peito, contraindo as escápulas. Retorne lentamente à posição inicial e repita.', '2025-03-12 12:04:25.629', '2025-03-12 12:04:25.629');
VALUES('51cd45f4-3cf0-41e3-a15b-00cd4ae9519f', '6beb2180-1553-4989-b3a8-b952b5a10494', 'Pulldown com Pegada Aberta', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/pulldown-com-pegada-aberta.png', 'https://www.youtube.com/watch?v=Mdp7kuhZD_M', 'Sente-se no aparelho de polia alta e segure a barra com as mãos afastadas além da largura dos ombros. Puxe a barra em direção à parte superior do peito, contraindo as escápulas. Retorne lentamente à posição inicial e repita.', '2025-03-12 12:05:14.609', '2025-03-12 12:05:14.609');
VALUES('42019c76-449c-4bb1-a90b-ec14719b0c77', '6beb2180-1553-4989-b3a8-b952b5a10494', 'Pulldown com Barra em V', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/pulldown-com-barra-em-v.png', 'https://www.youtube.com/watch?v=7wEpfpKAiQ0', 'Sente-se no aparelho de polia alta e segure a barra em V com as palmas voltadas para dentro. Puxe a barra em direção à parte superior do peito, contraindo as escápulas. Retorne lentamente à posição inicial e repita.', '2025-03-12 12:06:02.103', '2025-03-12 12:06:02.103');
VALUES('f8ea2a8a-ec3d-4850-83d0-8d1548db0c11', '6beb2180-1553-4989-b3a8-b952b5a10494', 'Remada Shotgun', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/remada-shotgun.png', 'https://www.youtube.com/watch?v=vGvryEp84qE', 'Fixe uma alça única na polia baixa e segure-a com uma mão em pegada neutra. Puxe a alça em direção ao tronco, girando levemente o corpo e contraindo as escápulas. Retorne lentamente à posição inicial e repita, depois troque de lado.', '2025-03-12 12:06:50.226', '2025-03-12 12:06:50.226');
VALUES('6901d9d9-7c3c-44f4-8207-5bc8928d407c', '6beb2180-1553-4989-b3a8-b952b5a10494', 'Pulldown com Corda e Braços Retos', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/pulldown-com-corda-e-braços-retos.png', 'https://www.youtube.com/watch?v=hlxb2zthgUw', 'Fique em pé diante da polia alta e segure a corda com as palmas voltadas para dentro. Mantendo os braços estendidos e o tronco levemente inclinado, puxe a corda para baixo até a altura dos quadris, separando as pontas no final do movimento. Retorne lentamente à posição inicial e repita.', '2025-03-12 12:07:29.623', '2025-03-12 12:07:29.623');
VALUES('2f9a5a67-d790-4d57-83a5-938da78a0b41', '6beb2180-1553-4989-b3a8-b952b5a10494', 'Pulldown com Pegada Supinada e Fechada', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/pulldown-com-pegada-supinada-e-fechada.png', 'https://www.youtube.com/watch?v=KBuyWEs7-cs', 'Sente-se no aparelho de polia alta e segure a barra com as mãos próximas e as palmas voltadas para você. Puxe a barra em direção à parte superior do peito, mantendo os cotovelos próximos ao corpo e contraindo as escápulas. Retorne lentamente à posição inicial e repita.', '2025-03-12 12:08:15.896', '2025-03-12 12:08:15.896');
VALUES('facf24be-2824-44fd-a543-774dc5b46617', 'f4566ab9-c3bd-4e69-90ff-81e2ae093e44', 'Liberação Miofascial do Pescoço com Tiger Tail', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/liberação-miofascial-do-pescoço-com-tiger-tail.png', 'https://www.youtube.com/watch?v=C8hJmUXlogA', 'Segure o Tiger Tail (bastão de massagem) com as duas mãos e posicione-o na lateral do pescoço. Role suavemente para cima e para baixo, aplicando leve pressão para aliviar a tensão. Repita o movimento em ambos os lados do pescoço.', '2025-03-12 12:09:21.782', '2025-03-12 12:09:21.782');
VALUES('6e3cafc7-b869-4b4e-90b1-952ea52550db', 'cd249b03-61e4-4363-b7a7-c7689a4bf1ad', 'Abdominal Oblíquo (Side Crunch)', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/abdominal-oblíquo-(side-crunch).png', 'https://www.youtube.com/watch?v=dRhloYXeE3E', 'Deite-se de lado com as pernas levemente flexionadas e uma mão apoiada na cabeça. Eleve o tronco lateralmente, contraindo os oblíquos, e retorne lentamente à posição inicial. Repita e troque de lado.', '2025-03-17 04:21:57.724', '2025-03-17 04:21:57.724');
VALUES('79f296a1-dec1-423a-abe9-4af5573d826a', 'cd249b03-61e4-4363-b7a7-c7689a4bf1ad', 'Rotação Madeireiro', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rotação-madeireiro.png', 'https://www.youtube.com/watch?v=0VWnOjUO7ks', 'Fique em pé com os pés na largura dos ombros e segure um cabo ou halter com as duas mãos. Comece com as mãos acima de um ombro e gire o tronco, levando o peso em diagonal até o quadril oposto. Retorne controladamente à posição inicial e repita, depois troque de lado.', '2025-03-17 04:22:59.283', '2025-03-17 04:22:59.283');
VALUES('26979fc6-f57e-4845-bc78-7a1ed070900c', 'cd249b03-61e4-4363-b7a7-c7689a4bf1ad', 'Prancha Lateral com Queda de Quadril', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/prancha-lateral-com-queda-de-quadril.png', 'https://www.youtube.com/watch?v=LYRJgW0WuGE', 'Deite-se de lado, apoiando o antebraço no chão e alinhando o corpo. Abaixe o quadril em direção ao chão sem tocar, depois eleve-o novamente contraindo o core. Repita e troque de lado.', '2025-03-17 04:23:42.894', '2025-03-17 04:23:42.894');
VALUES('f0ba575a-234c-4df1-8d6f-466c2b96d767', 'cd249b03-61e4-4363-b7a7-c7689a4bf1ad', 'Rotação com Landmine', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/rotação-com-landmine.png', 'https://www.youtube.com/watch?v=iszktbsU8nE', 'Fique em pé com os pés na largura dos ombros e segure a extremidade da barra fixa no landmine com as duas mãos. Mantendo os braços estendidos, gire o tronco e mova a barra de um lado para o outro em um arco controlado. Contraia o core e repita alternando os lados.', '2025-03-17 04:24:31.031', '2025-03-17 04:24:31.031');
VALUES('2aca5dfe-48f6-4061-8d31-d342d3ba0a0d', 'cd249b03-61e4-4363-b7a7-c7689a4bf1ad', 'Elevação no Cabo Ajoelhado', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/elevação-no-cabo-ajoelhado.png', 'https://www.youtube.com/watch?v=I3wWVJkEBfo', 'Ajoelhe-se com ambos os joelhos no chão e segure a alça do cabo em um dos lados do corpo. Mantendo o core firme, puxe a alça diagonalmente para cima e atravessando o corpo, girando levemente o tronco. Retorne lentamente à posição inicial e repita, depois troque de lado.', '2025-03-17 04:25:17.058', '2025-03-17 04:25:17.058');
VALUES('bc4b0ae7-cf8a-41ab-ac22-8b5838bece3f', 'e9419c8c-58e2-491d-b60b-bcfaccb24c3e', 'Liberação da Fáscia Palmar com Bola de Lacrosse', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/liberação-da-fáscia-palmar-com-bola-de-lacrosse.png', 'https://www.youtube.com/watch?v=uRd7fmEyjQc', 'Coloque uma bola de lacrosse na palma da mão e pressione-a contra uma superfície firme, como uma mesa ou parede. Faça movimentos circulares e para frente e para trás, aplicando leve pressão para aliviar a tensão. Repita o processo na outra mão.', '2025-03-17 04:26:46.558', '2025-03-17 04:26:46.558');
VALUES('85d0cae1-4562-4258-84e0-3e51820a2ea6', 'b6576ec6-76b6-4d25-a04a-10259a20b842', 'Liberação da Fáscia Plantar com Bola de Lacrosse', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/liberação-da-fáscia-plantar-com-bola-de-lacrosse.png', 'https://www.youtube.com/watch?v=C7yZFUj1LC8', 'Coloque uma bola de lacrosse sob a planta do pé e aplique leve pressão. Role a bola para frente e para trás, concentrando-se nos pontos de maior tensão. Repita o processo no outro pé.', '2025-03-17 04:27:34.090', '2025-03-17 04:27:34.090');
VALUES('8a28f838-2aeb-43c6-b43a-c205d184a315', 'd5f25ec2-3fb8-4839-8ea0-920ff7090299', 'Agachamento Livre com Barra', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/agachamento-livre-com-barra.png', 'https://www.youtube.com/watch?v=R2dMsNhN3DE', 'Posicione a barra sobre a parte superior das costas e segure-a com as mãos afastadas na largura dos ombros. Com os pés na largura dos ombros, agache empurrando os quadris para trás e mantendo as costas retas. Desça até os joelhos ficarem em 90° e suba, estendendo os quadris e joelhos.', '2025-03-17 04:28:58.952', '2025-03-17 04:28:58.952');
VALUES('bcdbb383-f92e-4360-a798-a50c183d5f74', 'd5f25ec2-3fb8-4839-8ea0-920ff7090299', 'Agachamento Goblet com Halter', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/agachamento-goblet-com-halter.png', 'https://www.youtube.com/watch?v=5Y3KW5rWMh4', 'Segure um halter próximo ao peito com as duas mãos. Afaste os pés na largura dos ombros e mantenha o peito ereto. Agache empurrando os quadris para trás até os joelhos formarem um ângulo de 90°. Retorne à posição inicial, estendendo os quadris e joelhos.', '2025-03-17 04:29:44.506', '2025-03-17 04:29:44.506');
VALUES('abfc2cdb-388e-4507-93ae-6f40c75beb94', 'd5f25ec2-3fb8-4839-8ea0-920ff7090299', 'Agachamento com Halteres', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/agachamento-com-halteres.png', 'https://www.youtube.com/watch?v=x5vB3-LoPHc', 'Fique em pé com os pés na largura dos ombros, segurando um halter em cada mão ao lado do corpo. Agache empurrando os quadris para trás e dobrando os joelhos até formar um ângulo de 90°. Retorne à posição inicial, estendendo os quadris e joelhos.', '2025-03-17 04:30:41.605', '2025-03-17 04:30:41.605');
VALUES('ac146062-80b5-4531-b003-a12422afb248', 'd5f25ec2-3fb8-4839-8ea0-920ff7090299', 'Avanço com Halteres', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/avanço-com-halteres.png', 'https://www.youtube.com/watch?v=koeV-24SQOo', 'Fique em pé segurando um halter em cada mão, com os braços ao lado do corpo. Dê um passo à frente, flexionando ambos os joelhos até formarem um ângulo de 90°. Empurre o pé da frente para voltar à posição inicial e repita com a outra perna.', '2025-03-17 04:31:30.262', '2025-03-17 04:31:30.262');
VALUES('92873e68-e0cf-46b8-8099-c2f0cfceeccc', 'd5f25ec2-3fb8-4839-8ea0-920ff7090299', 'Leg Press', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/leg-press.png', 'https://www.youtube.com/watch?v=sEM_zo9w2ss', 'Sente-se na máquina de leg press, posicionando os pés na largura dos ombros na plataforma. Empurre a carga para cima, estendendo os joelhos sem travá-los completamente. Flexione os joelhos controladamente para retornar à posição inicial e repita.', '2025-03-17 04:32:17.347', '2025-03-17 04:32:17.347');
VALUES('159f5b95-ac3c-471a-bc99-720ffbe904d0', 'd5f25ec2-3fb8-4839-8ea0-920ff7090299', 'Extensão de Pernas', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/extensão-de-pernas.png', 'https://www.youtube.com/watch?v=0fl1RRgJ83I', 'Sente-se na máquina de extensão de pernas e ajuste o rolo acolchoado sobre a parte inferior das pernas. Estenda os joelhos até que as pernas fiquem retas, contraindo os quadríceps. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:33:07.935', '2025-03-17 04:33:07.935');
VALUES('4b5ef260-800b-4a1c-8c91-881134fcdf75', 'd5f25ec2-3fb8-4839-8ea0-920ff7090299', 'Agachamento Búlgaro com Halteres', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/agachamento-búlgaro-com-halteres.png', 'https://www.youtube.com/watch?v=uqI3GVwfToU', 'Fique em pé segurando um halter em cada mão e apoie um pé em um banco atrás de você. Agache flexionando o joelho da perna da frente até formar um ângulo de 90°, mantendo o tronco ereto. Retorne à posição inicial e repita, depois troque de perna.', '2025-03-17 04:33:46.576', '2025-03-17 04:33:46.576');
VALUES('a140e178-082c-48c7-8e43-fedb6f7f3cf5', 'd5f25ec2-3fb8-4839-8ea0-920ff7090299', 'Subida em Banco com Halteres', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/subida-em-banco-com-halteres.png', 'https://www.youtube.com/watch?v=k5THw4U761Q', 'Segure um halter em cada mão, com os braços ao lado do corpo. Coloque um pé sobre um banco ou caixa resistente e empurre o corpo para cima, estendendo completamente a perna. Retorne controladamente à posição inicial e repita, alternando as pernas.', '2025-03-17 04:34:36.427', '2025-03-17 04:34:36.427');
VALUES('cabe253b-b7f0-4e8d-9f79-9277cc2f80b5', '76325fb9-e74c-4f0b-872d-59b5c4b56101', 'Elevação Lateral com Halteres', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/elevação-lateral-com-halteres.png', 'https://www.youtube.com/watch?v=IwWvZ0rlNXs', 'Fique em pé segurando um halter em cada mão, com os braços ao lado do corpo. Levante os halteres lateralmente até a altura dos ombros, mantendo uma leve flexão nos cotovelos. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:37:29.543', '2025-03-17 04:37:29.543');
VALUES('3771f8e9-4438-486d-b073-b9a925f786a0', '76325fb9-e74c-4f0b-872d-59b5c4b56101', 'Desenvolvimento Militar', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/desenvolvimento-militar.png', 'https://www.youtube.com/watch?v=j7ULT6dznNc', 'Fique em pé com os pés na largura dos ombros e segure a barra na altura dos ombros, com as palmas voltadas para frente. Empurre a barra para cima até estender completamente os braços. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:38:31.295', '2025-03-17 04:38:31.295');
VALUES('1dcdd907-8481-47c9-8815-39014a8027ea', '76325fb9-e74c-4f0b-872d-59b5c4b56101', 'Desenvolvimento com Halteres Sentado', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/desenvolvimento-com-halteres-sentado.png', 'https://www.youtube.com/watch?v=FRxZ6wr5bpA', 'Sente-se em um banco com encosto e segure um halter em cada mão na altura dos ombros, com as palmas voltadas para frente. Empurre os halteres para cima até estender completamente os braços. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:39:07.382', '2025-03-17 04:39:07.382');
VALUES('f67b78a7-d7b7-449c-8c6d-438334b7de09', '76325fb9-e74c-4f0b-872d-59b5c4b56101', 'Desenvolvimento Arnold Sentado', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/desenvolvimento-arnold-sentado.png', 'https://www.youtube.com/watch?v=hmnZKRpYaV8', 'Sente-se em um banco com encosto e segure um halter em cada mão na altura do queixo, com as palmas voltadas para você. Gire as mãos para frente enquanto empurra os halteres para cima até estender os braços. Retorne lentamente à posição inicial, invertendo o movimento, e repita.', '2025-03-17 04:39:46.972', '2025-03-17 04:39:46.972');
VALUES('9c897eb6-74ff-4b9d-9d8b-385bca1b921b', '76325fb9-e74c-4f0b-872d-59b5c4b56101', 'Crucifixo Inverso com Halteres', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/crucifixo-inverso-com-halteres.png', 'https://www.youtube.com/watch?v=Fgz_FdzDukE', 'Fique em pé com os joelhos levemente flexionados e incline o tronco para frente, mantendo as costas retas. Segure um halter em cada mão com as palmas voltadas para dentro. Levante os halteres lateralmente até a altura dos ombros, contraindo as escápulas. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:40:39.864', '2025-03-17 04:40:39.864');
VALUES('316db1e5-c09d-4fbb-8648-0f67ee28fbf5', '76325fb9-e74c-4f0b-872d-59b5c4b56101', 'Desenvolvimento com Halteres em Pé', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/desenvolvimento-com-halteres-em-pé.png', 'https://www.youtube.com/watch?v=YUVQwXDzMKc', 'Fique em pé com os pés na largura dos ombros, segurando um halter em cada mão na altura dos ombros, com as palmas voltadas para frente. Empurre os halteres para cima até estender completamente os braços. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:41:22.031', '2025-03-17 04:41:22.031');
VALUES('e45e8263-0860-4efe-bd9f-214fba172373', '76325fb9-e74c-4f0b-872d-59b5c4b56101', 'Desenvolvimento de Ombros na Máquina Smith', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/desenvolvimento-de-ombros-na-máquina-smith.png', 'https://www.youtube.com/watch?v=3IuNFXG-aNI', 'Sente-se ou fique em pé sob a barra da máquina Smith, segurando-a na altura dos ombros com as palmas voltadas para frente. Pressione a barra para cima até estender completamente os braços. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:42:09.332', '2025-03-17 04:42:09.332');
VALUES('f194673a-2810-4b5a-bbcc-2d9ab8de4a5d', '76325fb9-e74c-4f0b-872d-59b5c4b56101', 'Elevação Lateral com Halteres Sentado', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/elevação-lateral-com-halteres-sentado.png', 'https://www.youtube.com/watch?v=Xf1Vg0k4TnA', 'Sente-se em um banco com os pés firmes no chão, segurando um halter em cada mão ao lado do corpo. Levante os halteres lateralmente até a altura dos ombros, mantendo uma leve flexão nos cotovelos. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:42:52.206', '2025-03-17 04:42:52.206');
VALUES('ba1d372d-34ec-482a-b85e-7d2b0a4b8e25', '6feef40f-1f0c-4d5c-a5f4-89aa419fea9f', 'Remada Alta com Barra', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/remada-alta-com-barra.png', 'https://www.youtube.com/watch?v=QZD6vq22qJg', 'Fique em pé com os pés na largura dos ombros e segure a barra com as mãos afastadas na largura dos ombros, palmas voltadas para o corpo. Puxe a barra em direção ao peito, mantendo os cotovelos mais altos que os punhos. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:44:29.859', '2025-03-17 04:44:29.859');
VALUES('2dbfd984-81be-4d0a-98b9-2269f970f665', '6feef40f-1f0c-4d5c-a5f4-89aa419fea9f', 'Encolhimento de Ombros com Halteres', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/encolhimento-de-ombros-com-halteres.png', 'https://www.youtube.com/watch?v=dj2Gm628kas', 'Fique em pé segurando um halter em cada mão ao lado do corpo, com as palmas voltadas para dentro. Eleve os ombros o máximo possível, contraindo o trapézio. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:45:14.401', '2025-03-17 04:45:14.401');
