VALUES('d79e5a16-f35a-4d06-8d01-a07c04891129', '6feef40f-1f0c-4d5c-a5f4-89aa419fea9f', 'Encolhimento de Ombros com Halteres Sentado', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/encolhimento-de-ombros-com-halteres-sentado.png', 'https://www.youtube.com/watch?v=YeILDnoeYEk', 'Sente-se em um banco com os pés firmes no chão, segurando um halter em cada mão ao lado do corpo. Eleve os ombros o máximo possível, contraindo o trapézio. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:47:28.320', '2025-03-17 04:47:28.320');
