VALUES('2cee7301-8827-4576-957e-a2bdbb5df268', '6742531b-eb47-4bb7-b136-be92b2c38db8', 'Extensão de Tríceps com Barra Reta', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/extensão-de-tríceps-com-barra-reta.png', 'https://www.youtube.com/watch?v=mpZ9VRisAyw', 'Fique em pé diante da polia alta e segure a barra reta com as palmas voltadas para baixo. Mantendo os cotovelos próximos ao corpo, estenda os braços totalmente para baixo. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:49:33.649', '2025-03-17 04:49:33.649');
VALUES('c3871da3-bedd-4c31-b289-6af67de295a6', '6742531b-eb47-4bb7-b136-be92b2c38db8', 'Extensão de Tríceps com Halteres deitado', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/extensão-de-tríceps-com-halteres-deitado.png', 'https://www.youtube.com/watch?v=2KQO3fqInVA', 'Deite-se em um banco reto segurando um halter em cada mão, com os braços estendidos acima do peito e as palmas voltadas para dentro. Flexione os cotovelos lentamente, trazendo os halteres em direção à cabeça. Estenda os braços de volta à posição inicial e repita.', '2025-03-17 04:50:19.811', '2025-03-17 04:50:19.811');
VALUES('7d2fc438-65a9-4c26-b4a3-86df6ae62d49', '6742531b-eb47-4bb7-b136-be92b2c38db8', 'Supino no Chão com Halteres', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/supino-no-chão-com-halteres.png', 'https://www.youtube.com/watch?v=gaBOfLlIXjs', 'Deite-se no chão segurando um halter em cada mão, com os braços flexionados e os cotovelos tocando o solo. Empurre os halteres para cima até estender completamente os braços. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:51:12.715', '2025-03-17 04:51:12.715');
VALUES('78566940-14ed-4969-9622-50df68dd042f', '6742531b-eb47-4bb7-b136-be92b2c38db8', 'Extensão de Tríceps com Halter Sentado', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/extensão-de-tríceps-com-halter-sentado.png', 'https://www.youtube.com/watch?v=LlCFtWCQc5s', 'Sente-se em um banco com encosto e segure um halter com as duas mãos acima da cabeça, mantendo os braços estendidos. Flexione os cotovelos lentamente, abaixando o halter atrás da cabeça. Estenda os braços de volta à posição inicial e repita.', '2025-03-17 04:51:51.489', '2025-03-17 04:51:51.489');
VALUES('afce9214-d45c-46f5-aa74-a67d71626314', '6742531b-eb47-4bb7-b136-be92b2c38db8', 'Extensão de Tríceps com Corda', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/extensão-de-tríceps-com-corda.png', 'https://www.youtube.com/watch?v=LzwgB15UdO8', 'Fique em pé diante da polia alta e segure a corda com as palmas voltadas para dentro. Mantendo os cotovelos próximos ao corpo, estenda os braços totalmente para baixo, separando as pontas da corda no final do movimento. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:52:37.019', '2025-03-17 04:52:37.019');
VALUES('02b4bd9e-688b-49e6-9500-26744ad1bb7c', '6742531b-eb47-4bb7-b136-be92b2c38db8', 'Extensão de Tríceps com Barra ou Halter', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/extensão-de-tríceps-com-barra-ou-halter.png', 'https://www.youtube.com/watch?v=SI-THv1gZZQ', 'Sente-se ou fique em pé segurando uma barra EZ ou um halter com ambas as mãos acima da cabeça. Flexione os cotovelos lentamente, abaixando o peso atrás da cabeça. Estenda os braços de volta à posição inicial e repita.', '2025-03-17 04:53:23.935', '2025-03-17 04:53:23.935');
VALUES('0e12595c-92ce-45b5-bd68-27c5b1dafc42', '6742531b-eb47-4bb7-b136-be92b2c38db8', 'Skullcrusher com Barra EZ', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/skullcrusher-com-barra-ez.png', 'https://www.youtube.com/watch?v=K6MSN4hCDM4', 'Deite-se em um banco reto segurando uma barra EZ com as mãos na largura dos ombros. Com os braços estendidos acima do peito, flexione os cotovelos lentamente, trazendo a barra em direção à testa. Estenda os braços de volta à posição inicial e repita.', '2025-03-17 04:54:01.185', '2025-03-17 04:54:01.185');
VALUES('364c15b2-a89e-43bc-8039-527560a80e85', '6742531b-eb47-4bb7-b136-be92b2c38db8', 'Tríceps Kickback com Halteres', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/tríceps-kickback-com-halteres.png', 'https://www.youtube.com/watch?v=BL9CzOQZDrs', 'Fique em pé com os joelhos levemente flexionados e incline o tronco para frente, mantendo as costas retas. Segure um halter em cada mão com os cotovelos dobrados a 90°. Estenda os braços completamente para trás, contraindo o tríceps. Retorne lentamente à posição inicial e repita.', '2025-03-17 04:54:35.957', '2025-03-17 04:54:35.957');
VALUES('ea98fafc-f370-43fc-9dc7-ba5ad9cbee01', '6742531b-eb47-4bb7-b136-be92b2c38db8', 'Extensão de Tríceps com Barra deitado', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/extensão-de-tríceps-com-barra-deitado.png', 'https://www.youtube.com/watch?v=jR7Y5YcugYc', 'Deite-se em um banco reto segurando uma barra com as mãos na largura dos ombros. Com os braços estendidos acima do peito, flexione os cotovelos lentamente, trazendo a barra em direção à testa. Estenda os braços de volta à posição inicial e repita.', '2025-03-17 04:55:50.396', '2025-03-17 04:55:50.396');
VALUES('8537fd68-6534-432f-994d-d174d995f9ab', '6742531b-eb47-4bb7-b136-be92b2c38db8', 'Extensão de Tríceps com Halter em Pé', '4', '12', '20', '60', 'https://workoutx-bucket.s3.us-east-2.amazonaws.com/exercises/extensão-de-tríceps-com-halter-em-pé.png', 'https://www.youtube.com/watch?v=VjmgzEmODnI', 'Fique em pé segurando um halter com as duas mãos acima da cabeça, mantendo os braços estendidos. Flexione os cotovelos lentamente, abaixando o halter atrás da cabeça. Estenda os braços de volta à posição inicial e repita.', '2025-03-17 04:56:28.293', '2025-03-17 04:56:28.293');